import React from "react";
import { useParams } from "react-router-dom";
import TaskForm from "../components/TaskForm";

const EditTask = () => {
    const { id } = useParams();
    return (
        <div>
            <TaskForm task={{ id }} isEditing={true} />
        </div>
    );
};

export default EditTask;
